""" PLOTS """
def get_marker_every(data_x, interval=1000):
    if len(data_x) == 0:
        return None
    # Calculate how many data points correspond to the desired interval
    step = max(1, len(data_x) // (max(data_x) // interval)) if max(data_x) > 0 else 1
    return slice(0, None, step)


